    false,nt"url": null,nt"notes": "The dataset represents LiDAR elevations
    acquired during a leaf-off and a leaf-on vegetative condition for the Upper Panther
    Creek Watershed in the Yamhill County study area in Oregon. The date of collection
    for the leaf off data is 20071208. The date of collection for the leaf on data is
    20070903. The area of interest covers ~5577 acres (~8.71 sq miles). The LiDAR survey
    utilized a Leica ALS50 Phase II laser mounted in a Cessna Caravan 208B set to acquire
    greater than or equal to 105,000 pulses per second (i.e. 105 kHz pulse rate). The
    scan angle was plus or minus 14 degrees from nadir. These settings are designed
    to yield an average native density (number of pulses emitted by the laser system)
    of greater than or equal to 8 points per square meter over terrestrial surfaces.
    LiDAR intensity values were also collected. In some areas of heavy vegetation or
    forest cover, there may be relatively few ground points in the LiDAR data. Elevation
    values for open water surfaces are not valid elevation values because few LiDAR
    points are returned from water surfaces. Watershed Sciences, Inc. collected the
    LiDAR and created this data set for the Bureau of Land Management.",nt"license_title":
